    <><div className="center">
    <div className="cen">
    <h2 style={{color:"orange"}}>Slot Machine ðŸŽ°</h2>
    
    
    <hr className="wd"/>
    {Emojis.map((value)=>{
        return(
            <>
            <App x={value.x} y={value.y} z={value.z}/>
            <hr className="wd"/></>
        )
    })}
   
    </div>
    </div>
    </>
    ,document.getElementById("root")
)
